import React from 'react';
import Header from "./Header";
import {
  Container, Row
} from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Container>
        <Row>
          <Header />
        </Row>
      </Container>
    </div>
  );
}

export default App;
